import { useState } from "react";
import styles from "./Demo.module.scss";

export const DemoLocation = ({
  players,
  currentPlayer,
  currentUser,
  updatePlayer,
}) => {
  const [gameProgress, setGameProgress] = useState({ pickedUpKey: false });

  const keyPickup = async () => {
    await players.updateOne(
      { _id: currentUser.id },
      { $set: { gameProgress: { keyPickup: true } } }
    );
    setGameProgress({ pickedUpKey: true });
  };

  return (
    <div className={styles.demo}>
      <h1>Demo</h1>
      <div className={styles.game}>
        <h2>Game</h2>
        <svg
          width="100%"
          height="100%"
          viewBox="0 0 568 439"
          version="1.1"
          xmlns="http://www.w3.org/2000/svg"
          xmlnsXlink="http://www.w3.org/1999/xlink"
          xmlSpace="preserve"
          xmlnsSerif="http://www.serif.com/"
          //   style="fill-rule:evenodd;clip-rule:evenodd;stroke-linejoin:round;stroke-miterlimit:2;"
        >
          <g id="background" transform="matrix(1,0,0,1,-994,-1014)">
            <use
              xlinkHref="#_Image1"
              x="993"
              y="1013"
              width="570px"
              height="441px"
            />
          </g>
          {!currentPlayer?.gameProgress?.keyPickup && (
            <g
              onClick={() => {
                keyPickup();
              }}
              id="key"
              transform="matrix(1,0,0,1,-1066,-1121)"
              className={styles.key}
            >
              <use
                xlinkHref="#_Image2"
                x="1279"
                y="1279"
                width="135px"
                height="134px"
              />
            </g>
          )}
          <defs>
            <image
              id="_Image1"
              width="570px"
              height="441px"
              xlinkHref="data:image/png;base64,"
            />
            <image
              id="_Image2"
              width="135px"
              height="134px"
              xlinkHref="data:image/png;base64,"
            />
          </defs>
        </svg>
        <div>
          <button onClick={() => updatePlayer()}>Update Game State</button>
        </div>
      </div>
      <div className={styles.info}>
        <h2>MongoDB</h2>
        <p>"location": {JSON.stringify(currentPlayer.location)}</p>
        <p>"inventory": {JSON.stringify(currentPlayer.inventory)}</p>
        <p>"gameProgress": {JSON.stringify(gameProgress)}</p>
      </div>
      <button
        style={{ marginTop: "60px" }}
        onClick={async () => {
          setGameProgress({ pickedUpKey: false });
          await players.updateOne(
            { _id: currentUser.id },
            { $set: { gameProgress: { keyPickup: false } } }
          );
        }}
      >
        Reset
      </button>
    </div>
  );
};

export default DemoLocation;
